// Assetオブジェクトを作成
var Asset = {};

Asset.assets = [
  { type: 'image', name: 'screen', src: 'assets/screen.png' },
  { type: 'image', name: 'player', src: 'assets/player.png' },
  { type: 'image', name: 'tippy', src: 'assets/tippy.png' },
  { type: 'image', name: 'tippyTurned', src: 'assets/tippyTurned.png' },
  { type: 'image', name: 'anko', src: 'assets/anko.png' },
  { type: 'image', name: 'wildGeese', src: 'assets/wildGeese.png' },
  { type: 'image', name: 'gameover', src: 'assets/gameover.png' },
  { type: 'audio', name: 'go', src: 'data:audio/mpeg;base64,' },
  { type: 'audio', name: 'point', src: 'data:audio/mpeg;base64,' },
  { type: 'audio', name: 'miss', src: 'data:audio/mpeg;base64,' }
];

// 読み込んだ画像
Asset.images = {};

// 読み込んだ音声
Asset.audios = {};

Asset.loadAssets = function() {
  // Asset.assetsの要素について処理
  Asset.assets.forEach(function(asset) {
    switch (asset.type) {
      case 'image':
        Asset._loadImage(asset);
        break;
      case 'audio':
        Asset._loadAudio(asset);
        break;
    }
  });
};

Asset._loadImage = function(asset) {
  var image = new Image();
  image.src = asset.src;
  Asset.images[asset.name] = image; // Asset.imagesオブジェクトにasset.nameをキーとしてImageオブジェクトを保存
};

Asset._loadAudio = function(asset) {
  var audio = new Audio(asset.src);
  audio.volume = 0.2;
  audio.preload = 'auto';
  audio.autoplay = false;
  Asset.audios[asset.name] = audio;
};
